eval("module.exports = JSON.parse('{\"id\":\"000000\",\"name\":\"Sample\",\"created\":\"1674409747467\",\"tree\":{\"id\":\"000000\",\"collapsed\":false,\"children\":[{\"id\":\"000001\",\"collapsed\":false,\"children\":[]},{\"id\":\"1dc4c363-7440-4661-bbc5-7e995dc6ba71\",\"collapsed\":false,\"children\":[]},{\"id\":\"e067419d-85c3-422d-b8c4-41690be4450d\",\"collapsed\":false,\"children\":[{\"id\":\"6addd61d-d12f-4a27-a471-513becfff006\",\"children\":[],\"collapsed\":false}]},{\"id\":\"2ab706de-fea9-42a0-a900-e88b2950ceb3\",\"collapsed\":false,\"children\":[{\"id\":\"27c14755-ff26-4931-a676-b48cd958b781\",\"children\":[{\"id\":\"116f8e0f-ab62-450f-914e-5ca0956a457f\",\"children\":[],\"collapsed\":false}],\"collapsed\":true},{\"id\":\"d69efd32-fbf5-4b80-8a36-af1cb2af7b80\",\"children\":[{\"id\":\"b5a55548-f65d-496a-8bea-6b6ba8296e21\",\"children\":[],\"collapsed\":false}],\"collapsed\":true},{\"id\":\"2f67d730-c71b-4823-a986-fa510d9408e1\",\"children\":[{\"id\":\"40194ea5-9c28-4adb-bffe-4f59e7eca666\",\"children\":[],\"collapsed\":false}],\"collapsed\":true}]},{\"id\":\"21df5e96-d770-43f0-8bd1-1b01ab4626f9\",\"collapsed\":false,\"children\":[]},{\"id\":\"89c3267b-0114-4138-98a8-443b28d2e679\",\"collapsed\":false,\"children\":[{\"id\":\"6b457d6b-0228-41b7-bbba-6c0ba3b54f4d\",\"collapsed\":false,\"children\":[{\"id\":\"bad021fc-24d1-4560-8321-042c28d438a8\",\"collapsed\":false,\"children\":[]}]},{\"id\":\"9690699a-cb7d-4123-8fa5-f7a58a191a08\",\"children\":[{\"id\":\"2831a7aa-7291-4ebc-997f-5572e767f5c0\",\"children\":[],\"collapsed\":false}],\"collapsed\":false},{\"id\":\"88d336be-4910-4d74-b79a-441894af956d\",\"collapsed\":false,\"children\":[{\"id\":\"eb7fd6d7-b3fe-46e5-814c-655a6eec2ba4\",\"children\":[],\"collapsed\":false}]},{\"id\":\"51b2f235-b979-4d74-ad83-3e8b6152bb4a\",\"collapsed\":false,\"children\":[{\"id\":\"9c576012-7e8f-4d2b-b58b-1886eba43341\",\"children\":[],\"collapsed\":false}]}]},{\"id\":\"ef04ea02-aed6-4295-9117-2dcc45506f3a\",\"collapsed\":false,\"children\":[{\"id\":\"255bfdfc-9260-4cb1-9dcd-15f2c9eca2b2\",\"children\":[{\"id\":\"40b53a6f-0f43-40c2-b6d3-486982fc9d48\",\"children\":[{\"id\":\"724d0e33-fe2c-459e-9e75-e3311809ba36\",\"children\":[],\"collapsed\":false},{\"id\":\"588a65fd-69dd-4bb4-a819-f8c7f05a1d69\",\"collapsed\":false,\"children\":[]},{\"id\":\"13ea01fb-339d-4e65-9fad-123d72830efb\",\"collapsed\":false,\"children\":[]},{\"id\":\"a941538b-6834-4a65-b297-50036b89a41f\",\"collapsed\":false,\"children\":[]}],\"collapsed\":false},{\"id\":\"80b86062-a197-4adf-baa4-56a5953e0a77\",\"collapsed\":false,\"children\":[{\"id\":\"c09a5876-f825-4cb0-9a56-2916e28f9d02\",\"children\":[],\"collapsed\":false}]}],\"collapsed\":false}]}]},\"contentNodes\":{\"000001\":{\"id\":\"000001\",\"created\":1674409747467,\"type\":\"text\",\"content\":\"**Welcome to my Outliner**<br>\"},\"e067419d-85c3-422d-b8c4-41690be4450d\":{\"id\":\"e067419d-85c3-422d-b8c4-41690be4450d\",\"created\":1674412571215,\"type\":\"text\",\"content\":\"This is my attempt to build a \\\\\"home base\\\\\" piece of software for myself. The goal is to be able to use this tool to serve as a way to write long-form content, manage my website, and keep notes + references. <br>\"},\"21df5e96-d770-43f0-8bd1-1b01ab4626f9\":{\"id\":\"21df5e96-d770-43f0-8bd1-1b01ab4626f9\",\"created\":1674412689419,\"type\":\"text\",\"content\":\"---\"},\"89c3267b-0114-4138-98a8-443b28d2e679\":{\"id\":\"89c3267b-0114-4138-98a8-443b28d2e679\",\"created\":1674412690374,\"type\":\"text\",\"content\":\"**FAQ**\"},\"9690699a-cb7d-4123-8fa5-f7a58a191a08\":{\"id\":\"9690699a-cb7d-4123-8fa5-f7a58a191a08\",\"created\":1674412696214,\"type\":\"text\",\"content\":\"**Why should I use this?**<br>\"},\"2831a7aa-7291-4ebc-997f-5572e767f5c0\":{\"id\":\"2831a7aa-7291-4ebc-997f-5572e767f5c0\",\"created\":1674412702948,\"type\":\"text\",\"content\":\"You shouldn\\'t. This isn\\'t a piece of software for you - it\\'s for me. You may find some use for it, but you also may not. Along the way features will be introduced that likely break things for you.<br>\"},\"51b2f235-b979-4d74-ad83-3e8b6152bb4a\":{\"id\":\"51b2f235-b979-4d74-ad83-3e8b6152bb4a\",\"created\":1674412786944,\"type\":\"text\",\"content\":\"**Ok I used it, but my data is trapped?**<br>\"},\"9c576012-7e8f-4d2b-b58b-1886eba43341\":{\"id\":\"9c576012-7e8f-4d2b-b58b-1886eba43341\",\"created\":1674412794788,\"type\":\"text\",\"content\":\"I\\'ll be adding the ability to export the entire thing as OPML, so that there\\'s some interop between this and all of [Dave Winer\\'s](https://scripting.com) tooling. Hopefully that\\'s enough. At some point I\\'m going to also introduce support for [RemoteStorage](https://remotestorage.io) which is a project that I\\'ve previous contributed to in the past, but have mostly been neglecting lately. I\\'m hoping between those two options that\\'ll be enough for \\\\\"backups\\\\\" of data.<br>\"},\"88d336be-4910-4d74-b79a-441894af956d\":{\"id\":\"88d336be-4910-4d74-b79a-441894af956d\",\"created\":1674412890012,\"type\":\"text\",\"content\":\"**If I use this, does this mean you have access to all my data?**<br>\"},\"eb7fd6d7-b3fe-46e5-814c-655a6eec2ba4\":{\"id\":\"eb7fd6d7-b3fe-46e5-814c-655a6eec2ba4\",\"created\":1674412907752,\"type\":\"text\",\"content\":\"No. I\\'m trying to keep this entirely \\\\\"static\\\\\" and \\\\\"offline first\\\\\". You should be able to use this without concern that I\\'ll be watching what you type. Like I said - this is primarily a tool for me, and I already have access to all of my content.<br>\"},\"bad021fc-24d1-4560-8321-042c28d438a8\":{\"id\":\"bad021fc-24d1-4560-8321-042c28d438a8\",\"created\":1674491030563,\"type\":\"text\",\"content\":\"An outliner is simply a tool that allows for \\\\\"infinite\\\\\" hierarchy. You can create nested nodes, move them around, and generally treat it like a big old bulleted list. It seem silly, but being able to sort your list whenever you feel like is a huge deal. <br>\"},\"1dc4c363-7440-4661-bbc5-7e995dc6ba71\":{\"id\":\"1dc4c363-7440-4661-bbc5-7e995dc6ba71\",\"created\":1674491120429,\"type\":\"text\",\"content\":\"I\\'ve long been a user of [Dave Winer\\'s](https://scripting.com) outliner tools for the last decade since I first discovered Outliners. They\\'ve been a massive benefit to me as I attempt to organize my thoughts across a variety of subjects. I\\'ve also always struggled to adopt existing tooling as I found that they were ALMOST what I wanted.<br>\"},\"6addd61d-d12f-4a27-a471-513becfff006\":{\"id\":\"6addd61d-d12f-4a27-a471-513becfff006\",\"created\":1674491272253,\"type\":\"text\",\"content\":\"![Thumbs Up](http://www.tmsauto.com/wp-content/uploads/3-thumbs-up.jpg)<br>\"},\"ef04ea02-aed6-4295-9117-2dcc45506f3a\":{\"id\":\"ef04ea02-aed6-4295-9117-2dcc45506f3a\",\"created\":1674494561538,\"type\":\"text\",\"content\":\"**Changelog**\"},\"255bfdfc-9260-4cb1-9dcd-15f2c9eca2b2\":{\"id\":\"255bfdfc-9260-4cb1-9dcd-15f2c9eca2b2\",\"created\":1674494572205,\"type\":\"text\",\"content\":\"**2023-01-23 - Initial Release**<br>\"},\"40b53a6f-0f43-40c2-b6d3-486982fc9d48\":{\"id\":\"40b53a6f-0f43-40c2-b6d3-486982fc9d48\",\"created\":1674494588998,\"type\":\"text\",\"content\":\"The outliner supports all standard outliner functionality<br>\"},\"850bac59-c64f-4884-a24c-a10cad6b38c2\":{\"id\":\"850bac59-c64f-4884-a24c-a10cad6b38c2\",\"created\":1674494607269,\"type\":\"text\",\"content\":\"---\"},\"cccd8044-92b6-4e89-887c-2f979f4e0cab\":{\"id\":\"cccd8044-92b6-4e89-887c-2f979f4e0cab\",\"created\":1674494607378,\"type\":\"text\",\"content\":\"---\"},\"724d0e33-fe2c-459e-9e75-e3311809ba36\":{\"id\":\"724d0e33-fe2c-459e-9e75-e3311809ba36\",\"created\":1674496047585,\"type\":\"text\",\"content\":\"Ability to create/remove nodes at the same level or as children of the selected node<br>\"},\"588a65fd-69dd-4bb4-a819-f8c7f05a1d69\":{\"id\":\"588a65fd-69dd-4bb4-a819-f8c7f05a1d69\",\"created\":1674496066859,\"type\":\"text\",\"content\":\"Ability to move nodes up and down within the same level<br>\"},\"13ea01fb-339d-4e65-9fad-123d72830efb\":{\"id\":\"13ea01fb-339d-4e65-9fad-123d72830efb\",\"created\":1674496078557,\"type\":\"text\",\"content\":\"Ability to lift/lower nodes in the hierarchy<br>\"},\"80b86062-a197-4adf-baa4-56a5953e0a77\":{\"id\":\"80b86062-a197-4adf-baa4-56a5953e0a77\",\"created\":1674496103163,\"type\":\"text\",\"content\":\"**Known Issues**<br>\"},\"c09a5876-f825-4cb0-9a56-2916e28f9d02\":{\"id\":\"c09a5876-f825-4cb0-9a56-2916e28f9d02\",\"created\":1674496115316,\"type\":\"text\",\"content\":\"The `findNodeInTree` method seems to jump through the list multiple times and needs to be properly terminated. There\\'s a hack in place right now that stops it from triggering the handler multiple times, but it would be good to get that fixed<br>\"},\"a941538b-6834-4a65-b297-50036b89a41f\":{\"id\":\"a941538b-6834-4a65-b297-50036b89a41f\",\"created\":1674496226731,\"type\":\"text\",\"content\":\"Ability to fold/unfold nodes to hide/display nested content<br>\"},\"6b457d6b-0228-41b7-bbba-6c0ba3b54f4d\":{\"id\":\"6b457d6b-0228-41b7-bbba-6c0ba3b54f4d\",\"created\":1674499489509,\"type\":\"text\",\"content\":\"**What is an outliner?**<br>\"},\"2ab706de-fea9-42a0-a900-e88b2950ceb3\":{\"id\":\"2ab706de-fea9-42a0-a900-e88b2950ceb3\",\"created\":1674504320041,\"type\":\"text\",\"content\":\"**Features**<br>\"},\"27c14755-ff26-4931-a676-b48cd958b781\":{\"id\":\"27c14755-ff26-4931-a676-b48cd958b781\",\"created\":1674504328945,\"type\":\"text\",\"content\":\"- [x] A simple keyboard-navigated outliner where each node supports Markdown<br>\"},\"116f8e0f-ab62-450f-914e-5ca0956a457f\":{\"id\":\"116f8e0f-ab62-450f-914e-5ca0956a457f\",\"created\":1674504343967,\"type\":\"text\",\"content\":\"This is probably the single biggest difference from other outliners - and it really is a simple change. The text nodes are all markdown - so by default it supports anything that would render via [marked.js](https://marked.js.org/). <br>\"},\"974ebeda-2d49-4a31-9bcc-666c6b910702\":{\"id\":\"974ebeda-2d49-4a31-9bcc-666c6b910702\",\"created\":1674504414730,\"type\":\"text\",\"content\":\"Roadmap<br>\"},\"b00509a3-694a-4159-b9f0-fdc11e1e04e3\":{\"id\":\"b00509a3-694a-4159-b9f0-fdc11e1e04e3\",\"created\":1674504415116,\"type\":\"text\",\"content\":\"---\"},\"3c51e000-8bf7-469d-94e5-4480b980993c\":{\"id\":\"3c51e000-8bf7-469d-94e5-4480b980993c\",\"created\":1674504438403,\"type\":\"text\",\"content\":\"---\"},\"0da3090a-9a6f-4b3f-9607-0e97bd4318f5\":{\"id\":\"0da3090a-9a6f-4b3f-9607-0e97bd4318f5\",\"created\":1674504442196,\"type\":\"text\",\"content\":\"Current\"},\"d69efd32-fbf5-4b80-8a36-af1cb2af7b80\":{\"id\":\"d69efd32-fbf5-4b80-8a36-af1cb2af7b80\",\"created\":1674504453605,\"type\":\"text\",\"content\":\"- [ ] Search!\"},\"b5a55548-f65d-496a-8bea-6b6ba8296e21\":{\"id\":\"b5a55548-f65d-496a-8bea-6b6ba8296e21\",\"created\":1674504458424,\"type\":\"text\",\"content\":\"This is the most important one. The ability to fuzzy search across the entirety of the document and jump to any node possible. When I was working with Fargo + Little Outliner, I tried building extensions that would allow me to do this - but they never quite worked as I envisioned. I\\'m hoping to provide a full fuzzy-text search system<br>\"},\"315c3870-a6c2-49b6-89b1-8c9e0a950b4c\":{\"id\":\"315c3870-a6c2-49b6-89b1-8c9e0a950b4c\",\"created\":1674504522443,\"type\":\"text\",\"content\":\"---\"},\"4f84fa9b-bc13-43fa-9e31-cf4a0c976d27\":{\"id\":\"4f84fa9b-bc13-43fa-9e31-cf4a0c976d27\",\"created\":1674504522958,\"type\":\"text\",\"content\":\"---\"},\"2f67d730-c71b-4823-a986-fa510d9408e1\":{\"id\":\"2f67d730-c71b-4823-a986-fa510d9408e1\",\"created\":1674504531115,\"type\":\"text\",\"content\":\"- [ ] Export Data<br>\"},\"bb64c043-b69f-49f8-bde4-9018822d929b\":{\"id\":\"bb64c043-b69f-49f8-bde4-9018822d929b\",\"created\":1674504546666,\"type\":\"text\",\"content\":\"Being able to \\\\\"publish\\\\\" a node and <br>\"},\"40194ea5-9c28-4adb-bffe-4f59e7eca666\":{\"id\":\"40194ea5-9c28-4adb-bffe-4f59e7eca666\",\"created\":1674504558701,\"type\":\"text\",\"content\":\"Being able to export the data to OPML at any point will go a long way to ensuring that the tool never locks me in if I decide to leave<br>\"},\"82956c9c-33d1-44e1-aca7-298cdfc4c72c\":{\"id\":\"82956c9c-33d1-44e1-aca7-298cdfc4c72c\",\"created\":1674504834120,\"type\":\"text\",\"content\":\"---\"},\"a1f74891-c98b-4fc2-a7ce-c18b2ad2b8d0\":{\"id\":\"a1f74891-c98b-4fc2-a7ce-c18b2ad2b8d0\",\"created\":1674504838755,\"type\":\"text\",\"content\":\"---\"},\"e1e60a99-74da-436c-b140-ce8c10832889\":{\"id\":\"e1e60a99-74da-436c-b140-ce8c10832889\",\"created\":1674504891810,\"type\":\"text\",\"content\":\"---\"},\"de5fd362-402e-4769-8429-9fecab882da0\":{\"id\":\"de5fd362-402e-4769-8429-9fecab882da0\",\"created\":1674504894934,\"type\":\"text\",\"content\":\"---\"},\"de9ca950-e7c0-4f10-b65e-a5cf9000a618\":{\"id\":\"de9ca950-e7c0-4f10-b65e-a5cf9000a618\",\"created\":1674504899904,\"type\":\"text\",\"content\":\"---\"},\"8f1a787f-01b5-4b72-8308-8a3fe0a96383\":{\"id\":\"8f1a787f-01b5-4b72-8308-8a3fe0a96383\",\"created\":1674504923176,\"type\":\"text\",\"content\":\"eys\"}}}');\n\n//# sourceURL=webpack://outline-browser/./src/test-data.json?");

